INSERT INTO `t_itf_dyn_words` VALUES (12,'3','三科综合','','由表${T#}可以看出，就总分而言，校1008、校1011、校1005表现明显好于其他学校；校1007、校1002、校1009表现和其他学校相比欠佳。就学科而言，校1008、校1007、校1010的语文表现明显好于其他学校；校1006、校1009、校1002的语文表现和其他学校相比欠佳；校1011、校1008、校1005的数学表现明显好于其他学校；校1009、校1007的数学表现和其他学校相比欠佳；校1011、校1008、校1012的英语表现明显好于其他学校；校1007、校1009的英语表现和其他学校相比欠佳。'),(12,'3','语文','','由表${T#}可以看出，校1008、校1007、校1010的语文表现明显好于其他学校；校1006、校1009、校1002的语文表现和其他学校相比欠佳。'),(12,'3','数学','','由表${T#}可以看出，校1011、校1008、校1005的数学表现明显好于其他学校；校1009、校1007的数学表现和其他学校相比欠佳。'),(12,'3','英语','','由表${T#}可以看出，校1011、校1008、校1012的英语表现明显好于其他学校；校1007、校1009的英语表现和其他学校相比欠佳。'),(12,'5','语文','','由图${P#}可以看出，本区本年级学生的语文基本呈现正态分布。\n具体来看，语文在(60,70]分数段的学生比例最高，为42.7%；在(70,80]分数段的学生比例次高，为28.3%。'),(12,'5','数学','','由图${P#}可以看出，本区本年级学生的数学基本呈现正态分布。\n具体来看，数学在(20,30]分数段的学生比例最高，为26.7%；在(30,40]分数段的学生比例次高，为22.3%。'),(12,'5','英语','','由图${P#}可以看出，本区本年级学生的英语基本呈现正态分布。\n具体来看，英语在(40,50]分数段的学生比例最高，为23.5%；在(50,60]分数段的学生比例次高，为23.1%。'),(12,'5','三科综合','','由图${P#}可以看出，本区本年级学生的三科综合基本呈现正态分布。\n具体来看，三科综合在(120,150]分数段的学生比例最高，为34.7%；在(150,180]分数段的学生比例次高，为34.3%。'),(12,'6','语文','','由图${P#}可以看出，从语文来看，在“优秀”等级上，校1007的学生比例相对较高，为38.6%。校1009的学生比例相对较低，为0.8%。在“合格”及以上等级上，校1008的学生比例最高，为97.7%；校1002学生比例相对较低，为64.4%。'),(12,'6','数学','','由图${P#}可以看出，从数学来看，在“优秀”等级上，校1011的学生比例相对较高，为43.3%。校1009、校1007的学生比例相对较低，为0.0%。在“合格”及以上等级上，校1008的学生比例最高，为99.7%；校1007学生比例相对较低，为65.8%。'),(12,'6','英语','','由图${P#}可以看出，从英语来看，在“优秀”等级上，校1011的学生比例相对较高，为39.6%。校1009的学生比例相对较低，为0.8%。在“合格”及以上等级上，校1011、校1012的学生比例最高，为100.0%；校1009学生比例相对较低，为47.0%。'),(12,'6','三科综合','','由图${P#}可以看出，从三科综合来看，在“优秀”等级上，校1008的学生比例相对较高，为47.3%。校1009、校1007的学生比例相对较低，为0.0%。在“合格”及以上等级上，校1011、校1012的学生比例最高，为100.0%；校1009学生比例相对较低，为40.6%。'),(12,'7','语文','','图${P#}呈现了本区不同性别学生在总分上的对比分析情况。从图可以看出，本区女生总分平均分为68.6，男生总分平均分为63.6，女生总分偏高，#TODO_HANDWORK'),(12,'7','数学','','图${P#}呈现了本区不同性别学生在总分上的对比分析情况。从图可以看出，本区女生总分平均分为32.2，男生总分平均分为33.2，男生总分偏高，#TODO_HANDWORK'),(12,'7','英语','','图${P#}呈现了本区不同性别学生在总分上的对比分析情况。从图可以看出，本区女生总分平均分为55.5，男生总分平均分为49.9，女生总分偏高，#TODO_HANDWORK'),(12,'7','三科综合','','图${P#}呈现了本区不同性别学生在总分上的对比分析情况。从图可以看出，本区女生总分平均分为156.3，男生总分平均分为146.6，女生总分偏高，#TODO_HANDWORK'),(12,'22','语文','能力','由图${P#}呈现了本区各学校在语文各能力维度上的表现情况。根据本次语文的考试框架，语文在能力维度上分为记忆与理解、运用与实践、创新与迁移。\n在图中，不同颜色的点表示各班学生在每个维度上的平均得分率。\n由图${P#}可以看出，在本次考试中，就学校而言，从一级维度来看，校1008、校1010在“记忆与理解”维度和校1007在“运用与实践”维度和校1007、校1008在“创新与迁移”维度上的得分率明显高于其他学校，校1002、校1009在“记忆与理解”维度和校1002、校1013在“运用与实践”维度和校1002、校1009在“创新与迁移”维度上的得分率明显低于其他学校；\n从二级维度来看，校1008、校1012在“识别记忆”维度和校1007在“整体感知”维度和校1008、校1012在“整体把握”维度和校1010、校1008、校1007在“理解欣赏”维度和校1007在“理解探究”维度和校1005、校1007、校1008在“鉴赏评价”维度和校1008在“自主选材”维度和校1006、校1012在“自由表达”维度和校1004、校1010在“文本呈现”维度子维度上的得分率明显高于其他学校，校1009、校1002在“识别记忆”维度和校1009、校1002在“整体感知”维度和校1002、校1006、校1009在“整体把握”维度和校1002、校1009在“理解欣赏”维度和校1013、校1002在“理解探究”维度和校1002在“自主选材”维度和校1009、校1002、校1004在“自由表达”维度和校1009、校1006在“文本呈现”维度子维度上的得分率明显低于其他学校。'),(12,'22','语文','知识','由图${P#}呈现了本区各学校在语文各知识维度上的表现情况。根据本次语文的考试框架，语文在知识维度上分为积累、阅读、写作。\n在图中，不同颜色的点表示各班学生在每个维度上的平均得分率。\n由图${P#}可以看出，在本次考试中，就学校而言，从一级维度来看，校1012、校1008在“积累”维度和校1008、校1007在“阅读”维度和校1011在“写作”维度上的得分率明显高于其他学校，校1002、校1009在“积累”维度和校1009、校1002在“阅读”维度和校1009、校1002在“写作”维度上的得分率明显低于其他学校；\n从二级维度来看，校1012、校1008在“基础知识”维度和校1010、校1007在“诗文默写”维度和校1007、校1005、校1008在“文学性文章”维度和校1008、校1007、校1010在“文言文”维度和校1011在“创造性写作”维度子维度上的得分率明显高于其他学校，校1002、校1009在“基础知识”维度和校1006、校1002在“诗文默写”维度和校1002、校1009在“文学性文章”维度和校1009、校1002在“文言文”维度和校1009、校1002在“创造性写作”维度子维度上的得分率明显低于其他学校。'),(12,'22','数学','能力','由图${P#}呈现了本区各学校在数学各能力维度上的表现情况。根据本次数学的考试框架，数学在能力维度上分为学习理解、实践应用、创造迁移。\n在图中，不同颜色的点表示各班学生在每个维度上的平均得分率。\n由图${P#}可以看出，在本次考试中，就学校而言，从一级维度来看，校1008、校1011、校1005在“学习理解”维度和校1011、校1005、校1008在“实践应用”维度和校1008、校1011在“创造迁移”维度上的得分率明显高于其他学校，校1007、校1009在“学习理解”维度和校1009、校1007在“实践应用”维度和校1007在“创造迁移”维度上的得分率明显低于其他学校；\n从二级维度来看，校1008、校1011、校1005在“识别与回忆”维度和校1008、校1011、校1005在“计算与操作”维度和校1001、校1008、校1011在“解释与交流”维度和校1008、校1011、校1005在“分析与概括”维度和校1008、校1011、校1005在“推理与论证”维度和校1008、校1011在“简单问题解决”维度和校1008、校1011在“综合应用”维度子维度上的得分率明显高于其他学校，校1007、校1009在“识别与回忆”维度和校1009、校1007在“计算与操作”维度和校1006在“解释与交流”维度和校1007、校1013、校1009在“分析与概括”维度和校1007、校1009在“推理与论证”维度和校1007、校1009在“简单问题解决”维度和校1007在“综合应用”维度子维度上的得分率明显低于其他学校。'),(12,'22','数学','知识','由图${P#}呈现了本区各学校在数学各知识维度上的表现情况。根据本次数学的考试框架，数学在知识维度上分为代数与几何、函数、统计与概率、集合。\n在图中，不同颜色的点表示各班学生在每个维度上的平均得分率。\n由图${P#}可以看出，在本次考试中，就学校而言，从一级维度来看，校1008、校1011、校1005在“函数”维度和校1005、校1011、校1008在“集合”维度上的得分率明显高于其他学校，校1009、校1007在“函数”维度和校1007、校1009在“集合”维度上的得分率明显低于其他学校；\n从二级维度来看，校1008、校1011、校1005在“函数的基本知识”维度和校1008、校1011在“三角函数”维度和校1005、校1011、校1008在“集合”维度子维度上的得分率明显高于其他学校，校1009、校1007在“函数的基本知识”维度和校1009、校1007在“三角函数”维度和校1007、校1009在“集合”维度子维度上的得分率明显低于其他学校。'),(12,'22','数学','素养','由图${P#}呈现了本区各学校在数学各素养维度上的表现情况。根据本次数学的考试框架，数学在素养维度上分为直观、推理、运算、建模、数据处理。\n在图中，不同颜色的点表示各班学生在每个维度上的平均得分率。\n由图${P#}可以看出，在本次考试中，就学校而言，从一级维度来看，校1011、校1008在“直观”维度和校1011、校1008在“推理”维度和校1005、校1011、校1008在“运算”维度上的得分率明显高于其他学校，校1002、校1007、校1013在“直观”维度和校1009、校1007在“推理”维度和校1009、校1007在“运算”维度上的得分率明显低于其他学校。'),(12,'22','英语','能力','由图${P#}呈现了本区各学校在英语各能力维度上的表现情况。根据本次英语的考试框架，英语在能力维度上分为听力、阅读、口语表达、写作。\n在图中，不同颜色的点表示各班学生在每个维度上的平均得分率。\n由图${P#}可以看出，在本次考试中，就学校而言，从一级维度来看，校1008、校1012、校1011在“听力”维度和校1008、校1011、校1012在“阅读”维度和校1008、校1011、校1012在“写作”维度上的得分率明显高于其他学校，校1009、校1007在“听力”维度和校1009、校1007在“阅读”维度和校1009在“写作”维度上的得分率明显低于其他学校；\n从二级维度来看，校1011、校1008、校1012在“根据所获取信息进行简单推断”维度和校1011在“理解归纳话语的主旨要义”维度和校1005、校1012在“理解说话者的意图、观点和态度”维度和校1012、校1008、校1011在“推断隐含意义”维度和校1012、校1008、校1011在“理解归纳语篇的主旨要义”维度和校1008、校1011在“理解作者意图、观点和态度”维度和校1008、校1011、校1012在“理解句子、段落之间的逻辑关系”维度和校1008、校1011、校1012在“应用文”维度子维度上的得分率明显高于其他学校，校1007、校1009在“根据所获取信息进行简单推断”维度和校1009、校1007在“理解归纳话语的主旨要义”维度和校1009、校1007在“理解说话者的意图、观点和态度”维度和校1007、校1009在“推断隐含意义”维度和校1007、校1009在“理解归纳语篇的主旨要义”维度和校1007、校1002、校1009在“理解作者意图、观点和态度”维度和校1009、校1007、校1002在“理解句子、段落之间的逻辑关系”维度和校1009在“应用文”维度子维度上的得分率明显低于其他学校。'),(12,'22','英语','知识','由图${P#}呈现了本区各学校在英语各知识维度上的表现情况。根据本次英语的考试框架，英语在知识维度上分为语法、词汇。\n在图中，不同颜色的点表示各班学生在每个维度上的平均得分率。\n由图${P#}可以看出，在本次考试中，就学校而言，从一级维度来看，校1011、校1008在“语法”维度和校1008、校1011、校1012在“词汇”维度上的得分率明显高于其他学校，校1007、校1009在“语法”维度和校1007、校1009在“词汇”维度上的得分率明显低于其他学校；\n从二级维度来看，校1008、校1011在“比较级”维度和校1012、校1011、校1005在“代词”维度和校1012、校1011在“介词”维度和校1011、校1008在“连词”维度和校1011、校1008在“句型”维度和校1008、校1011在“情态动词”维度和校1011在“非谓语动词”维度